import Button from 'react-bootstrap/Button';

function PhotoTile({launchItem}){
    return(
        <div>
            <h5>{launchItem.name}</h5>
            <Button href={launchItem.links.webcast} target="_blank" variant="primary">Webcast Link</Button>
            <img src={launchItem.links.flickr.original[0]} className="launchPhoto"/>
        </div>
    );
}

export default PhotoTile;
